import { Col, Row } from "react-bootstrap";

const CartItems=(props)=>{

    return(
        <React.Fragment>
            <p style={{fontFamily: "cursive", textAlign: "center"}}>Cart</p>
            <Row xs={3}>
                <Col>Item</Col>
                <Col>Price</Col>
                <Col>Quantity</Col>
            </Row>
        </React.Fragment>
    )
}

export default CartItems
